var virtualChartData = function(optList) {
    var llv = ['A+++', 'A++', 'A+', 'A', 'B', 'C', 'D']
    var lllo = ['AAA', 'AA', 'A', 'U'];

    function aa(type) {
        var count = 100;
        var list = [];
        var lll = lllo;

        if(type){
            lll = llv;
        }

        for (var i = 0; i < lll.length; i++) {
            var c = parseInt(Math.random() * count);

            if (i == lll.length - 1) {
                c = count;
            }
            list.push({
                name: lll[i],
                y: c
            });
            count = count - c;
        }
        return list;
    }

    var map = {};
    for (var i = 0; i < optList.length; i++) {
        var type = false;
        if(optList[i].lifttype.substring(0,1) == '4'){
            type = true;
        }
        map[optList[i].id] = aa(type);
    }
    return map;
}

